import React, { Component } from "react";
import {
    Route,
    NavLink,
    HashRouter
} from "react-router-dom";

class Main extends Component {
    render() {
        return (
            <div>
                <h1>Medical Card</h1>
                <div class="dataframe" align="right">
                    <h2>Patient Info</h2>
                </div>
                <div class="dataframe" align="left">
                    <h2>Patient list</h2>
                    <ul>
                        <li></li>
                        <li></li>
                    </ul>
                </div>
            </div>
        )
    }
}


export default Main;
